/2Q==) no-repeat 0px 0px;" src="http://gwt.google.com/samples/Showcase/showcase/clear.cache.gif" onload="this.__gwtLastUnhandledEvent=&quot;load&quot;;">',TPb="<img onload='",yVb="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",cGb='<input type="text" value="',bZb="<section id='about'> <div class='page-header'> <h1> Sfeir <small>Une r\xE9volution en marche avec une nouvelle g\xE9n\xE9ration de consultants<\/small> <\/h1> <\/div> <div class='row'> <div class='span-one-third'> <h3>Historique<\/h3>  <p> Cr\xE9\xE9 en 1985, le Groupe Sfeir est sp\xE9cialis\xE9 dans les services informatiques cr\xE9ateurs de valeur. <\/p>  <p> Historiquement pr\xE9sent dans les m\xE9tiers de la Finance et de l\u2019Assistance \xE0 ma\xEEtrise d\u2019ouvrage (AMOA), <a href='http://www.sfeir.com/decouvrir-sfeir/linnovation/'>suite ...<\/a>. <\/p>  <img alt='Logo Sfeir' class='logo' height='300px' src='images/logo.gif' style='padding-left:55px'>  <\/div>  <div class='span-one-third'> <h3>L'innovation Sfeir<\/h3> <p>L\u2019innovation chez Sfeir c\u2019est \xEAtre la premi\xE8re SSII \xE0 utiliser Google AppEngine, avoir la premi\xE8re application fran\xE7aise sur la market place Android, mettre en \u0153uvre depuis plus de quatre ans le plus gros projet agile en France. <\/p>  <p> Sfeir est accr\xE9dit\xE9 CIR (Cr\xE9dit Imp\xF4t Recherche) par le Minist\xE8re de l\u2019Enseignement Sup\xE9rieur et de la Recherche. <\/p>  <p> Sfeir est accr\xE9dit\xE9 CIR (Cr\xE9dit Imp\xF4t Recherche) par le Minist\xE8re de l\u2019Enseignement Sup\xE9rieur et de la Recherche. <\/p>  <p> Voir plus de d\xE9tail sur: <a href='http://www.sfeir.com/decouvrir-sfeir/linnovation/'>sfeir.com \u203A<\/a> <\/p> <p> <iframe allowtransparency='true' class='twitter-follow-button' frameborder='0' scrolling='no' src='http://platform.twitter.com/widgets/follow_button.html#_=1322829346351&amp;button=blue&amp;id=twitter-widget-0&amp;lang=en&amp;screen_name=sfeir' style='width: 300px; height: 20px;' title=''><\/iframe> <script src='http://platform.twitter.com/widgets.js' type='text/javascript'><\/script> <\/p> <\/div> <div class='span-one-third'> <h3>42\xE8me Etage<\/h3> <p>Cher Geek, Peut-\xEAtre avez-vous vu un ou plusieurs \xE9pisodes de notre Webs\xE9rie \u201C42\xE8me \xE9tage\u201D et vous avez voulu en savoir un peu plus sur notre Soci\xE9t\xE9 ? <\/p>  <p> Nous esp\xE9rons que nous vous avons fait rire et que vous avez appr\xE9ci\xE9 cette forme d\u2019humour et d\u2019autod\xE9rision d\xE9capante. <\/p>  <p> En tous les cas, nous sommes conscients de la n\xE9cessit\xE9 de faire \xE9voluer les pratiques de notre m\xE9tier. Au sein de Sfeir, nous avons fait le choix de red\xE9finir le cadre notre m\xE9tier \u2026 et de le faire savoir ! <\/p>  <p> Vous \xEAtes les bienvenus si vous souhaitez nous rejoindre, si vous partagez le m\xEAme \xE9tat d\u2019esprit que nous, si vous avez envie de redonner toute sa valeur au m\xE9tier de consultant en France, cr\xE9ateur de valeur pour ses clients <a href='http://www.sfeir.com/webserie-42eme-etage/'>suite ...<\/a> <\/p>  <img alt='42 \xE8me Etage' src='images/42.png'>  <\/div> <\/div> <\/section>",hYb="<span id='",eZb='<table class="condensed-table">',APb='<table><tbody>',GPb='<table><tfoot>',DPb='<table><thead>',xPb='<td class="',hZb="<td style='font-size:95%;width:270px;'>",LPb='<th colspan="',OPb='<tr onclick="" class="',$Ob='<tr>',fZb="<tr><td rowspan='3'>",dLb='=',EOb='>',YUb='?',lFb='@',iIb='A',NUb='A PotentialElement cannot be resolved twice.',MQb='A possible infinite loop has been detected in a Cell Widget. This usually happens when your SelectionModel triggers a SelectionChangeEvent when SelectionModel.isSelection() is called, which causes the table to redraw continuously.',ZHb='A request timeout has expired after ',JQb='AB196D9D7834625802449A82C5811B43.cache.png',FFb='ABQIAAAABDl4EKW7YlPhSMyQv5emrxRUwTJMJLC_3KWNdxN_hz3_GemwWxSkkH-4brndx9CHDrrZ6OxvsBCRpg',GFb='ABQIAAAAG8LzhtshQCjpSshU_uJjmxQVO5MPwI9UvwRT_LfvC9URSJfDHhQ
